<script setup>
import { onMounted, ref } from 'vue'
import axios from 'axios'

const hostname = ref(undefined);
const image = ref('/svg/Logo_Thick.svg');
const contests = ref([])
async function getContests() {
    try {
        const res = await axios.get('https://algcontest.rainng.com/')
        res.data.forEach(item => {
            if (item.oj !== 'JiSuanKe') {
                contests.value.push(item)
            }
        })
    }
    catch (e) {
        console.log(e)
    }
}
function getContestClass(status) {
    if (status === 'Register') {
        return 'background-color: #3bc539;'
    }
    else if (status === 'Public') {
        return 'background-color: rgb(73, 185, 255);'
    }
    else {
        return 'background-color: rgb(255, 234, 47);'
    }
}
function getContestStatusClass(status) {
    if (status === 'Register') {
        return 'background-color: #3bc539; width: 14px; height: 14px; border-radius: 50px;'
    }
    else if (status === 'Public') {
        return 'background-color: rgb(73, 185, 255); width: 14px; height: 14px; border-radius: 50px;'
    }
    else {
        return 'background-color: rgb(255, 234, 47); width: 14px; height: 14px; border-radius: 50px;'
    }
}
function getContestStatus(status) {
    if (status === 'Register') {
        return '报名中'
    }
    else if (status === 'Public') {
        return '已发布'
    }
    else {
        return '进行中'
    }
}
function getContestType(isOI) {
    if (isOI) {
        return 'OI赛制'
    }
    else {
        return 'ACM赛制'
    }
}
onMounted(() => {
    hostname.value = window.location.hostname
    if (hostname.value === 'newbie.frexlink.com') {
        image.value = '/svg/Logo_GLOBAL_Thick.svg'
    }
    getContests()
})
</script>

